import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Groceries and other things</h1>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <div id="container">

        </div>
      </header>
    </div>
  );
}

export default App;
